(53, 323, 'news and magazine', '<p><a href=\"https://www.youtube.com/watch?v=7m-t0ODOKLg\" target=\"Youtube\">Jatim News</a>What is Lorem Ipsum? Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum. Why do we use it? It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like). Where does it come from? Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum</p>\r\n', 23, '', '', '', '', '1', 'Active', 'news and magazine', '2022-08-03 00:21:59'),
(57, 456, 'Best School in Gondia - MLZS Gondia ', '<p>Mount Litera Zee School Gondia is a member of the K12 Pan India chain of Mount Litera Zee Schools under the aegis of Zee Learn Limited. The Mount Litera Zee School chain has many laurels in its cap for exemplary achievements in the Education sector. MLZS has a Pan India presence and a Universal learning system where the divide of big and small cities is bridged as all the students study the same curricula at the same time and the same pace.Mount Litera Zee School &ndash; Gondia houses state of the art infrastructure with the latest technological knowhow for holistic growth of the students. Security is of paramount importance and Mount Litera Zee School Gondia practices I-Care, a program dedicated to child safety.FLIP &amp; DCP are the Co-scholastic offerings which enable students to explore their entrepreneurship skills and enable children to be cyber smart and counteract the technological challenges. Both these offerings are continuous and chart the growth and awareness of the students.Mount Litera Zee School is an aspiration of new learning&rsquo;s and new exploration of talent without the constraints of Rote learning where understanding and clarity rules the day and mindless cramming is a thing of the past. Our students study in Smart classrooms wherein technology and knowledge are blended for retention and application. Socio Emotional skills are honed through various Clubs- and a plethora of personality building activities make &lsquo;Learning Fun&rsquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://www.mlzsgondia.com/\">website</a></p>\r\n', 20, '', '', '', '', '1', 'Active', 'Best School in Gondia   MLZS Gondia', '2022-08-27 12:46:46'),
(58, 466, 'Reduserer leddsmerter', '<p>Leddgikt kan finne sted i alle aldre for oss mennesker, men generelt inntrer det oftest n&aring;r man er blitt eldre. Faren ved leddsmerter er dannelsen av betennelsesvev i ledd og knokler. Dette vevet bryter ned brusk og fortrenger leddv&aelig;sken som &ldquo;sm&oslash;rer&rdquo; leddene v&aring;re. Dette er sv&aelig;rt smertefullt og mange mennesker opplever dette som en sv&aelig;rt negativ innvirkning p&aring; livskvaliteten. Kroppen trenger hjelp.</p>\r\n', 23, '', '', '', '', '1', 'Active', 'Reduserer leddsmerter', '2022-09-22 17:31:50'),
