(63, 327, 'New york Surfing 2024', '<p>The remote island nation of Kiribati has gone into lockdown after passengers on the first international flight in 10 months tested positive for Covid. Under the new measures, people have been told to stay at home and social gatherings are banned. Some 36 people on the flight from Fiji have tested positive. Four people have caught the virus from community transmission. Until last week, Kiribati had recorded just two Covid cases. Kiribati is one of the most isolated islands in the world. It is some 5,000km (3,100 miles) from its nearest continent, North America. On Tuesday, the government confirmed that 36 of the 54 passengers had tested positive. It said in a post on Facebook that all passengers are currently being monitored by health officials.. All of the passengers on the flight are fully vaccinated, the government said. However three members of the quarantine facility&#39;s security team have since tested positive. Another person who does not work at the facility has also contracted the virus, the government said. The lockdown came into force on Saturday but it is not clear how long it will last. People are not allowed to leave their homes unless for essential services. They can buy essential items from shops but only between 06:00 and 14:00.</p>\r\n', 8, '10782pexels-oliaggy-4652160.jpg', '2023-04-28', NULL, '7:00AM', 'John smith', 'surfing@company.com', '65465465', 'www.company.com', '28800 Orchard Lake Road, Suite 180 Farmington Hills, U.S.A.', '', '48034,48035', 234, '', '', '', 'Active', 'New york Surfing 2024', 'All', '1', '2023-04-24 08:29:08'),
