(589, 'LIST589', 323, '7', '31', 'Hamdan Bin Mohammed Smart University', '83962hbmsu-home_0.jpg', 1, 'PhD in Quality Management', '<p>&quot;The PhD in Quality Management focuses on maintaining organizational excellence through effective quality management strategies and procedures. The curriculum has been adapted to reflect recent shifts in quality management, including changes in customer behavior, the digital transformation, global supply chains and recalls, consumerism, and rapidly changing business environments.<br />\r\n<br />\r\nHamdan Bin Mohammed Smart University (HBMSU) seeks to produce graduates who can apply theoretical concepts while adhering to research ethics and methods, and using innovative solutions that are both academically rigorous and practical. The PhD program takes a multidisciplinary approach, drawing from fields such as social sciences, IT, service sciences, and data analytics, to evaluate operational efficiency and drive continuous improvement in various organizational contexts. This approach makes it accessible to applicants with a range of educational backgrounds and work experience.<br />\r\n<br />\r\nThe PhD program enhances graduate employability by providing robust research and analytical skills and the ability to address emerging quality management paradigms. With 60 credits, including 30 for core and elective courses and 30 for the dissertation, students will be prepared for academic and industry careers.<br />\r\n<br />\r\nThe HBMSU Smart Campus provides online interactive sessions through a blended learning model, accredited by the UAE Ministry of Education&#39;s Commission for Academic Accreditation. This allows students to participate from anywhere in the world without disrupting their schedules.&quot;</p>\r\n', 'Dubai Academic City P.O.Box71400. Dubai. UAE', 'Dubai Academic City\r\nP.O.Box71400. Dubai. UAE\r\n', '009714 424 1111', '009714 424 1111', 'learn@hbmsu.ac.ae', 'https://www.hbmsu.ac.ae', 232, 1, '48043', '13688hbmsu-home_0.jpg', '18045full-fledged-online-banner-01.jpg', '', '', '', '', '', '', '', '', '', '', 1, 'PhD in Quality Management', '1000', '\"\"\"1.	Development of effective quality management strategies and procedures for maintaining organizational excellence.\r\n2.	Adaptation to recent shifts in quality management, such as changes in customer behavior and the digital transformation.\r\n3.	Application of theoretical concepts and innovative solutions that are both academically rigorous and contextually relevant.\r\n4.	Multidisciplinary approach to evaluating operational efficiency and driving continuous improvement in various organizational contexts.\r\n5.	Enhancement of graduate employability through robust research and analytical skills and the ability to address emerging quality management paradigms.\r\n6.	Preparation for academic and industry careers through completion of 60 credits, including core and elective courses and a dissertation.\r\n7.	Access to interactive online sessions through the HBMSU Smart Campus, allowing students to participate from anywhere in the world.\r\n8.	Accreditation by the UAE Ministry of Education\'s Commission for Academic Accreditation.\"\"\"\r\n', '', 'https://www.hbmsu.ac.ae/study/phd/doctor-philosophy-quality-management', '', 0, '', '', 0, '', '', 0, '', '', 0, '', '', 0, '', '', '', 'Language,Time,Status ,Duration ,Major,Mode,Level', 'English,Part Time,Private,3.5 Year,Total Quality Management,Blended,Phd', '', '', '', '', '', 'Active', 'Pending', 100, '0000-00-00', '0000-00-00', 0, '', '', 0, '', '', 0, '', '', 0, '', '', 0, '', '', 0, '', '', 0, '', '', 0, 'PhD in Quality Management', 2, '2023-02-15 00:57:16', '2023-02-15 00:11:49'),
