(1, 'New User Register (User)', 'mail_user_new_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n    <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Welcome to <span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Thank you for registering with us.</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Click the below link and enter below code to verify your email id and start your online business now.</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Verification Code : <b>\'.$verify_code.\'</b></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><a href=\"\'.$webpage_full_link_with_verification_link.\'\" style=\"font-size: 15px;background: #fae73d;color: #000;font-weight: bold;width: 110px;border-radius: 50px;display: inline-block;text-align: center;cursor: pointer;text-decoration: none;padding: 8px 5px;\">Verify now</a></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>\r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>\r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n\r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(2, 'New User Register (Admin)', 'mail_admin_new_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n    <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">A new registration has been made</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Dear admin one new user has been registered in your website. Please find the user details below</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 20px;color:#000;font-weight: bold;line-height: 26px;\">User informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Name:</strong><span contenteditable=\"false\">\' . $first_name . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Email id:</strong><span contenteditable=\"false\">\' . $email_id . \'</span></td>\r\n                        </tr>\r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(3, 'Registered User Approval (User)', 'mail_user_approve_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Hi <span contenteditable=\"false\">\' . $first_name . \'</span>!</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Your Registration has been approved successfully for <span contenteditable=\"false\">\'.$admin_site_name.\'</span>. We\'re thrilled to have you on board. To get the most out of <span contenteditable=\"false\">\'.$admin_site_name.\'</span>, do this primary next step:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><a href=\"\'.$webpage_full_link_with_login.\'\" style=\"font-size: 14px;background: #21d78d;color: #fff;font-weight: bold;width: 180px;border-radius: 50px;display: inline-block;text-align: center;cursor: pointer;text-decoration: none;padding: 8px 5px;box-shadow: 0 2px 3px rgba(0,0,0,0.16);\">Access dashboard</a></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Login informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>User name:</strong><span contenteditable=\"false\">\' . $email_id . \' </span></td>\r\n                        </tr>   \r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td>You\'ve started a day. Once you login into your dashboard then you make a payment to click below link.</td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td><a href=\"\'.$webpage_full_link.\'\" style=\"font-size: 14px;background: #fae73d;color: #000;font-weight: bold;width: 180px;border-radius: 50px;display: inline-block;text-align: center;cursor: pointer;text-decoration: none;padding: 8px 5px;box-shadow: 0 2px 3px rgba(0,0,0,0.16);\">Start your payment</a></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>   \r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(4, 'Registered User Approval (Admin)', 'mail_admin_approve_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Dear Admin,</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>A new registration has been successfully approved. Please find the details below</td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 16px;color:#000;font-weight: bold;line-height: 26px;\">For reference, here\\\'s the user information:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>User name:</strong><span contenteditable=\"false\">\' . $email_id . \' </span></td>\r\n                        </tr>  \r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(5, 'Forgot Password (User)', 'mail_user_forgot', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Your password</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>We received a request to reset the password to access <span contenteditable=\"false\">\'.$admin_site_name.\'</span> with your email address (<span contenteditable=\"false\">\' . $email_id . \'</span>).</td>\r\n                        </tr>   \r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Login informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>User name:</strong><span contenteditable=\"false\">\' . $email_id . \' </span></td>\r\n                        </tr>     \r\n                        <tr>\r\n                            <td><strong>Password:</strong> <span contenteditable=\"false\">\' . $password . \'</span></td>\r\n                        </tr> \r\n                        <tr><td>&nbsp;</td></tr>       \r\n                        <tr>\r\n                            <td><a href=\"\'.$webpage_full_link_with_login.\'\" style=\"font-size: 14px;background: #fae73d;color: #000;font-weight: bold;width: 180px;border-radius: 50px;display: inline-block;text-align: center;cursor: pointer;text-decoration: none;padding: 8px 5px;box-shadow: 0 2px 3px rgba(0,0,0,0.16);\">Click here to login</a></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>\r\n                        <tr>\r\n                            <td>If you use <span contenteditable=\"false\">\'.$admin_site_name.\'</span> and were expecting this email, consider trying to request a password reset using the email address associated with your account.</td>\r\n                        </tr>     \r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>    \r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(6, 'Listing Add (User)', 'mail_user_new_listing', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Hi <span contenteditable=\"false\">\' . $first_name . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Your Listing has been successfully created. For your reference listing details below.</td>\r\n                        </tr>     \r\n                        <tr><td>&nbsp;</td></tr>        \r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Listing informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong> Listing name:</strong> <span contenteditable=\"false\">\' . $listing_name . \'</span></td>\r\n                        </tr>     \r\n                        <tr>\r\n                            <td><strong>Mobile Number :</strong> <span contenteditable=\"false\">\' . $listing_mobile . \'</span></td>