(2, 19, 1, 'U.S. Futures Rise as Traders Mull Virus, China Vow: Markets Wrap', 'Asian stocks were mixed and U.S. equity futures were steady Monday amid a mood of caution as traders evaluated spiking coronavirus cases and a weekend pledge of greater economic support from Chinaâ€™s central bank.\r\n\r\nShares fell in Japan and fluctuated in China, where the nationâ€™s monetary authority Saturday pledged greater support for the real economy and reiterated a goal of â€œhealthyâ€ growth in the property sector.\r\n\r\nAsian stocks were mixed and U.S. equity futures were steady Monday amid a mood of caution as traders evaluated spiking coronavirus cases and a weekend pledge of greater economic support from Chinaâ€™s central bank.\r\n\r\nShares fell in Japan and fluctuated in China, where the nationâ€™s monetary authority Saturday pledged greater support for the real economy and reiterated a goal of â€œhealthyâ€ growth in the property sector.\r\n\r\nAsian stocks were mixed and U.S. equity futures were steady Monday amid a mood of caution as traders evaluated spiking coronavirus cases and a weekend pledge of greater economic support from Chinaâ€™s central bank.\r\n\r\nShares fell in Japan and fluctuated in China, where the nationâ€™s monetary authority Saturday pledged greater support for the real economy and reiterated a goal of â€œhealthyâ€ growth in the property sector.\r\n\r\n', '374279.jpg', 'test viki title', 'test viki description', 'test viki keywords', 'Active', 'U S  Futures Rise as Traders Mull Virus  China Vow  Markets Wrap', '2021-12-27 12:45:53'),
